import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  display: flex;
  justify-content: center;
  align-items: center;
  background: url(../)
    ;

  height: 100vh;
  width: 100%;
`;

function Hero() {
  return (
    <Wrapper>
      <h1>My world</h1>
    </Wrapper>
  );
}

export default Hero;
